import React, { Component } from 'react';

import '../sass/Home.scss';
import logo from '../img/logo_white2.svg';
import mockups from '../img/mockups.png';

import ScrollIntoView from 'react-scroll-into-view'

const isMobile = window.innerWidth <= 600;


class Home extends Component {
    render() {
        return (
            <div className="Home">
                <div className="top">
                    <p> New <br/> Degree <br/> Works </p>
                </div>
                <div className="newPlanRow">
                    <p> New Plan </p>
                </div>
                <div className="planRow">
                    <div className="planContainer">
                        <div className="plan"> <p> Plan 1 </p> </div>
                        <div className="plan"> <p> Plan 2 </p> </div>
                        <div className="plan"> <p> Plan 3 </p> </div>
                        <div className="plan"> <p> Plan 4 </p> </div>
                    </div>
                </div>
            </div>
        );
    }
}

export default Home;
